const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Lancer</li><li>True Name: C\xFA Chulainn</li><li>Gender: Male</li><li>Source: Celtic mythology</li><li>Origin: Ireland</li><li>Alignment: Lawful Neutral</li><li>Height: 184 cm</li><li>Weight: 71 kg</li></ul><p><strong>Meta</strong></p><ul><li>Scenario writer: Hikaru Sakurai, Nasu Kinoko Original draft character designer: Takeuchi Takashi, Konoe Ototsugu</li><li>Character designer: Nakahara</li><li>CV: Nakai Kazuya</li><li>Major appearances: Fate/Prototype</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">A+</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">B</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magic Resistance: [C]</strong></p><p>Cancels magecraft with a chant lower than two verses. Can\u2019t cancel large spells, like High Thaumaturgy or Greater Rituals.</p><p><strong>Divinity: [B]</strong></p><p>C\xFA Chulainn, who is the son of the Sun god Lugh, has high attitude as a Divine Spirit.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Rune Magecraft: [B]</strong></p><p>Possession of Nordic Magic Crests, Runes, given from his mentor Sc\xE1thach. By using different Runes, strong and diverse effects can be used. Besides attacking, the main usages are effects proper of the Magic Resistance skill, effects of the Clairvoyance skill, effect of rising parameters, etc. These are all temporary, and can\u2019t be used simultaneously.</p><p><strong>Protection against Arrows: [B]</strong></p><p>A defensive effect against projectiles.</p><p><strong>Beast Killer: [B+]</strong></p><p>A special effect against Demonic Beasts or wild animals. C\xFA Chulainn, who knows deeply about the nature of beasts, knows the way to kill them.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="gae-bolg-piercing-crimson-spear" tabindex="-1"><a class="header-anchor" href="#gae-bolg-piercing-crimson-spear" aria-hidden="true">#</a> G\xE1e Bolg - Piercing Crimson Spear</h1><ul><li>Rank: B/B+</li><li>Type: Anti-Unit/Anti-Army Noble Phantasm</li><li>Range: 2~4/5~40</li><li>Maximum number of targets: 1 person/50 people</li></ul><p>G\xE1e Bolg. The spear of causality reversal. A crimson lance handed by his mentor Sc\xE1thach, as well as a certain kill spear technique.</p><p>It has two methods of attacking, an Anti-Unit thrust, and an Anti-Army throw.</p><p>Although it\u2019s not as if it was being sealed, for whatever reason, C\xFA Chulainn doesn\u2019t use it when attacking normally. Only when he is convinced he can give the target a decisive strike with his \u300Etrump card\u300F, he wields the crimson spear with a full-power True Name release.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First person pronoun: \u4FFA (ore) / \u30AA\u30EC (ore)</li><li>Second person pronoun: \u304A\u524D(omae)/\u30AA\u30DE\u30A8 (omae)/\u30A2\u30F3\u30BF (anta)</li><li>Third person pronoun: \u5974 (yatsu)/\u3007\u3007 (without honorifics) \u306A\u3069 (\u3007\u3007 nado)</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>A coarse but likable man. He doesn\u2019t talk about\u300Ewho is at the top\u300F between good people or villains, but since his roots lean towards justice, he\u2019s not mature enough to understand the unreasonableness of the world and the equality of good and evil. He\u2019s also an animal tamer. Specially compatible with dogs and wolves.<br> Compared with the Lancer summoned with the same True Name, he\u2019s equipped with heavy armor. But still exceeds the Agility parameter of \u300Ethat one\u300F with an A+. It\u2019s not a performance difference of the body, but the youthful and proactive personality can be thought to lead to a slight difference.<br> His feelings and emotions regarding his mentor Sc\xE1thach occupy a somewhat bigger place in his heart than \u300Ethat one\u300F Lancer\u2019s. It\u2019s unknown whether it is due to youth or due to the season. Truly the unreasonableness of the world, is it impossible to recognize the equality of good and evil\u2026\u2026</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>He finds the existence of a Master challenged to restore humanity likable, and wouldn\u2019t doubt to lend them his power. But, be careful. The reactions aren\u2019t completely applied in the same way as with\u300Ethat one\u300F Lancer with the same True Name.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u300CUlster\u2019s C\xFA Chulainn. Lancer. For starters, nice to meetcha.\u300D</p><p>\u300CThe hound of Culann is me. Yeah, I\u2019ll bite to death. The enemies, that\u2019s it.\u300D</p><p>\u300CJust because we\u2019re Heroic Spirits of \u300Ethe same hero\u300F, it doesn\u2019t mean the same one will always come. Whaat, you&#39;ll soon get used to it.\u300D</p><p>\u300CYou, do you like any animal? I, let\u2019s see \u2015\u2015 dogs, it is. Hounds in particular are good.\u300D</p><p>\u300CI don&#39;t really dislike it, but women always bring bad luck. But, a nice woman is attractive &#39;cause of that too. For real, ain\u2019t there anything worse?\u300D</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>He seems to be the very same person as the Lancer with the same True Name, but \u2015\u2015 his body and personality are seemingly slightly younger than \u300Ethat one\u300F.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Sc\xE1thach</strong></p><p>Compared to the homonym Heroic Spirit, his obsession with her is a bit stronger.</p><p><strong>Medb</strong></p><p>Perhaps because his feeling of annoyance when followed around is thinner, he doesn\u2019t put a bad face even if she\u2019s in front of him.</p><p><strong>Artoria</strong></p><p>\u2026\u2026 A woman? The Holy Sword Wielder?</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>Before painting I thought the number of lines was bad, but it was bad after all. Konoe-san is the designer of the armor, but I was making many speeches in my head, like &quot;what the hell is this, Konoe-san\u2026?!&quot; (Lol) (Nakahara)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-178.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-179.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-180.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-181.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 56);
